## bit10-bit12 invalid bit
## bit13-bit15 sarsensor,Tyr only use bit13 for single channel wifi sar; When sar HW absent,report all channel to 1
## bit16 default=1
## This cfg file only for Tyr,delete sarsensor3 and sarsensor2 states.

